class DynamicText extends React.Component {
  constructor(props) {
    super(props);
    this.state = { text: 'Initial Text' };
  }

  updateText = () => {
    this.setState({ text: 'Updated Text' });
  };

  render() {
    return (
      <div>
        <p>{this.state.text}</p>
        <button onClick={this.updateText}>Update Text</button>
      </div>
    );
  }
}

// Renderează componenta în DOM
React.render(<DynamicText />, document.getElementById('root'));
